import React from "react";
import DefaultPicture from '../assets/profile.png'

const UserListItem = (props) => {
  const { user }= props;
  return (
    <div className="list-group-item list-group-item-action">
        <img alt={`${user.username} profile`} src={user.image}></img>
      {user.username}
    </div>
  );
};

